import React, { useEffect } from 'react';
import './App.css';

function App() {
  useEffect(() => {
    const handleScroll = () => {
      const logoContainer = document.querySelector('.logo-container');
      if (window.pageYOffset > 80) { // Adjust 100 to the scroll position you prefer
        logoContainer.style.display = 'none';
      } else {
        logoContainer.style.display = 'block';
      }
    };

    // Add scroll event listener
    window.addEventListener('scroll', handleScroll);

    // Clean up function to remove the event listener
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);
  return (
    <div className="App">
      <header className="App-header">
      <div className="logo-container"></div>
        <nav className="Navbar">
          <div className="leftNav">
            <a href="#features">Features</a>
            <a href="#pricing">Pricing</a>
            <a href="#discover">Discover</a>
          </div>
          <a href="#login" className="login">Login</a>
          <a href="#joinWaitlist" className="joinWaitlist">Join Waitlist</a>
        </nav>
      </header>
      <main className="main-content">
        <div className="left-column">
          {/* Content for the left column if any */}
        </div>
        <div className="right-column">
          <h1>Image to Code in an INSTANT</h1>
          <p>Transform your images into executable code with just a few clicks. Experience the magic of automation.</p>
          <button>Try Now!</button>
        </div>
      </main>
    </div>
  );
}

export default App;
